import React from "react";

function Location() {
    return(
        <ul className="list-group d-inline-block">
            <li className="list-group-item">
                <input type="checkbox" id="city1" name="city1" value={"Casablanca"}></input>
                <label htmlFor="city1">&ensp;Casablanca</label>
            </li>
            <li className="list-group-item">
                <input type="checkbox" id="city2" name="city2" value={"Casablanca"}></input>
                <label htmlFor="city2">&ensp;Rabat</label>
            </li>
            <li className="list-group-item">
                <input type="checkbox" id="city3" name="city3" value={"Casablanca"}></input>
                <label htmlFor="city3">&ensp;Hocaima</label>
            </li>
        </ul>
    );
}

export default Location;
